import "../Styles/skills.css";

const Skills = () => {
    return (
        <div className='container'>
            <div className='skills'>
                <h2>Skills</h2>
                <div className='skills-flex-container'>
                    <div className='skill-container'>
                        <h3>JavaScript</h3>
                        <p className='skills-or-projects'>
                        A good knowledge of the language. I can create basic web applications using React library. I have also programmed Shelly controllers with mJS.
                        </p>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Skills;
